import './component/Login.css';
import Home from './component/Home';
import Login from './component/Login';
import {
  BrowserRouter,
  Switch,
  Route,
} from "react-router-dom";
function Hello() {
  return (
    <BrowserRouter>
      <Login />

      <Switch>
          <Route path="/Home">
            <Home />
          </Route>
        </Switch>
    </BrowserRouter>
  );
}



export default Hello
